import React from "react";

const Advice = () => {
  return (
    <div className="container">
      <div className="advice">
        <h2>Conseils</h2>
        <p>
          Voici quelques conseils utiles pour vous aider à rester concentré et
          productif tout au long de la journée.
        </p>
        <ul>
          <li>Faites des pauses régulières pour vous détendre</li>
          <li>Établissez des objectifs clairs et réalisables</li>
          <li>Évitez les distractions inutiles</li>
          <li>Restez hydraté et mangez sainement</li>
          <li>Dormez suffisamment pour permettre à votre corps de récupérer</li>
        </ul>
      </div>
    </div>
  );
};

export default Advice;
